import React from 'react';
import './App.css';
import Login from '.my-react-app/Components/LoginPage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to RaffCo's Stock Page</h1>
        <Login />
      </header>
    </div>
  );
}

export default App;
